public static String unescapeJava(String str) throws Exception {
	if (str == null) {
		return null;
	}
	int len = str.length();
	if (len == 0) {
		return str;
	}
	StringBuffer out = new StringBuffer(len);
	for (int x = 0; x < len; x++) {
		char ch = str.charAt(x);
		if (ch == '\\') {
			if (x == len - 1) {
				throw new Exception("Unterminated escape sequence in string literal");
			}
			char ch2 = str.charAt(x + 1);
			if (ch2 == 'u') {
				if (x == len - 4) {
					throw new Exception("Unterminated escape sequence in string literal");
				}
				String hex = str.substring(x + 2, x + 6);
				out.append((char) Integer.parseInt(hex, 16));
				x += 5;
			} else if (ch2 == 't') {
				out.append('\t');
				x++;
			} else if (ch2 == 'r') {
				out.append('\r');
				x++;
			} else if (ch2 == 'n') {
				out.append('\n');
				x++;
			} else if (ch2 == 'f') {
				out.append('\f');
				x++;
			} else if (ch2 == 'b') {
				out.append('\b');
				x++;
			} else if (ch2 == '0') {
				out.append('\0');
				x++;
			} else if (ch2 == 'x') {
				if (x == len - 2) {
					throw new Exception("Unterminated escape sequence in string literal");
				}
				String hex = str.substring(x + 2, x + 4);
				out.append((char) Integer.parseInt(hex, 16));
				x += 3;
			} else {
				out.append(ch2);
			}
		} else {
			out.append(ch);
		}
	}
	return out.toString();
}

